	play_anim_loop: function(anim_name,stagee,sent_sound,function_begin)
	{	
		if (sent_sound === undefined) {
          sent_sound = 0;
    	} 

		if (sent_sound)
		{
			ion.sound.play(sent_sound);
		}
		
		indx=this.stage_names.indexOf(stagee);

		if (indx>=0)
		{
			this.stages[indx].destroy();

		}
		else
		{
			this.stage_names.push(stagee);
			indx=this.stage_names.indexOf(stagee);
		}



		//this.stage = stagee;
		if(anim_name)
		{
			this.stages[indx] = new swiffy.Stage(document.getElementById(stagee), this[anim_name]);      
     		this.stages[indx].setBackground(null);
     		this.stages[indx].start();
     		//console.log(anim_name);
    		//console.log(this.stages[indx]);
     	}
     	//
     	if (function_begin!==undefined)
     	{
     		game_manager[function_begin](); 
     	}
     	game_manager.animations[stagee] = anim_name;
	},

	play_anim_and_loop: function(anim_name1,anim_name2,time,stagee,sent_sound,sent_sound2,function1,function2)
	{	
		if (sent_sound === undefined) {
          sent_sound = 0;
    	} 
    	
    	if (sent_sound)
		{
			ion.sound.play(sent_sound);
		}

		indx=this.stage_names.indexOf(stagee);

		if (indx>=0)
		{
			this.stages[indx].destroy();
		}
		else
		{
			this.stage_names.push(stagee);
			indx=this.stage_names.indexOf(stagee);
		}

		
		//this.stage = stagee;
		this.stages[indx] = new swiffy.Stage(document.getElementById(stagee), this[anim_name1]);      
     	this.stages[indx].setBackground(null);
     	this.stages[indx].start();

     	if (function1!==undefined)
     	{
     		game_manager[function1](); 
     	}

     	//this.timeouts[stagee]=setTimeout(function(){animation_manager.play_anim_loop(anim_name2,stagee,sent_sound2,function2);},time);
		this.put_timeout(anim_name2,stagee,sent_sound2,function2,time);

		game_manager.animations[stagee] = anim_name1;
	},


	put_timeout: function(anim_name2,stagee,sent_sound2,function2,time)
	{
		this.timeouts[stagee]=setTimeout(function(){animation_manager.play_anim_loop(anim_name2,stagee,sent_sound2,function2);},time);
		this.timeout_params[stagee]={"anim_name2":anim_name2,"stagee":stagee,"sent_sound2":sent_sound2,"function2":function2,"time":time};
	},

	stop_timer: function(stagee)
	{
		clearTimeout(this.timeouts[stagee]);
	},

